import EditMementosView from './EditMementos-view.js'
import axios from 'axios'
import React from 'react'

const EditMementos = ({ owner, photos, title, description, id, profilePicture, username, editMemento, onClick, loadData }) => {
    axios.get(`/photos/${owner}`).then(res => {
        console.log(res.data)
        loadData(res.data.map(p => {
            return photos.includes(p.id) ? { ...p, active: true } : p
        }), 'PHOTOS')
    })
    axios.get(`/globeData`).then(res => {
        loadData(res.data.map(c => {
            return {
                city: c.city,
                country: c.country,
                active: c.city + ', ' + c.country === title
            }
        }), 'CITIES')
    }).catch(err => alert(err))

    console.log(photos)

    return <EditMementosView owner={owner} photos={photos} title={title} description={description} id={id} profilePicture={profilePicture} username={username} onClick={onClick} />
}


export default EditMementos
